DROP TABLE IF EXISTS tempTable;
CREATE TABLE tempTable(__status VARCHAR(100) , sys_created_by VARCHAR(100), sys_created_on VARCHAR(100), sys_id VARCHAR(100), sys_mod_count VARCHAR(100), sys_updated_by VARCHAR(100), sys_updated_on VARCHAR(100), u_asset_number VARCHAR(100), u_device_type VARCHAR(100), u_management_ip VARCHAR(100), u_manufacturer VARCHAR(100), u_model_number VARCHAR(100), u_name VARCHAR(100), u_owner VARCHAR(100), u_parent_device VARCHAR(100), u_received_date VARCHAR(100), u_serial_number VARCHAR(100), u_status VARCHAR(100), u_telecom_room VARCHAR(100));
LOAD DATA LOCAL INFILE "output.csv" INTO TABLE tempTable COLUMNS TERMINATED BY ',' OPTIONALLY ENCLOSED BY '"' LINES TERMINATED BY '\r\n';
